import React from 'react';

const Header = ({ darkMode, setDarkMode }) => {
  return (
    <header className="fixed w-full bg-white dark:bg-gray-800 shadow-md z-10 transition-colors duration-300">
      <div className="container mx-auto px-4 py-3 flex justify-between items-center">
        <h1 className="text-xl font-bold text-indigo-600">[Your Name]</h1>

        <nav className="hidden md:flex space-x-6">
          <a href="#about" className="hover:text-indigo-500 transition">About</a>
          <a href="#skills" className="hover:text-indigo-500 transition">Skills</a>
          <a href="#projects" className="hover:text-indigo-500 transition">Projects</a>
          <a href="#blog" className="hover:text-indigo-500 transition">Blog</a>
          <a href="#contact" className="hover:text-indigo-500 transition">Contact</a>
        </nav>

        <button
          onClick={() => setDarkMode(!darkMode)}
          className="p-2 rounded-full bg-gray-200 dark:bg-gray-700"
        >
          {darkMode ? '‚òÄÔ∏è' : 'üåô'}
        </button>
      </div>
    </header>
  );
};

export default Header;
